import React, { Component } from 'react';
import App from './_app';
import { Router } from 'react-router'

class Index extends Component {
  render() {
    const history = createBrowserHistory()

    return (
      <div className="index">
        <Router history={browserHistory}>
          <App />
        </Router>
      </div>
    )
  }
}

export default Index;
